import { Card, CardBody, Form, FormGroup, Input } from "reactstrap";

const AddPost = () => {
  return (
    <Card>
      <CardBody>
        <div>
          <h3>This is Add post component</h3>
        </div>
        <Form>
          <FormGroup>
            <Label for=""></Label>
            <Input type="text" />
          </FormGroup>
        </Form>
      </CardBody>
    </Card>
  );
};

export default AddPost;
